unsigned char Unicode::getAttribute(char16_t codepoint) {
    unsigned char ret = bmpTable[codepoint >> 1];
    if (codepoint & 1) {
        ret = ret & 0xF;
    } else {
        ret >>= 4;
    }
    return ret;
}

bool Unicode::IsIdStart(char16_t codepoint) {
    return !!(getAttribute(codepoint) & 1);
}
bool Unicode::IsIdContinue(char16_t codepoint) {
    return !!(getAttribute(codepoint) & 2);
}
bool Unicode::IsSpace(char16_t codepoint) {
    return !!(getAttribute(codepoint) & 4);
}
